import React from 'react'
import Slide from "react-slick"

function Subheader() {
    const settings = {
        dots: true,
        pauseOnFocus:true,
        infinite: true,
        arrows:false,
        speed: 400,
        slidesToShow: 5,
        autoplay:true,
        slidesToScroll: 1
      };
    
    const companys = [
        {
            name:"LC WAİKİKİ",
            img:"ssss"
        },
        {
            name:"KİNETİX",
            img:"aaaaa"
        }
    ]
    return (
        <div className=" w-full flex flex-col items-center">
        <div className="container h-10  mx-auto w-full  mt-20  "> 
           <Slide {...settings}>
              
               {companys.map((data)=>{
                return(<div className=" bg-black text-black">
                <div></div>
                <p>{data.name}</p>
                </div>)
            })}</Slide> 
        </div>
        </div>
    )
}

export default Subheader
